export default function About() {
  return (
    <section id="about" className="p-8 bg-dark">
      <h2 className="text-2xl font-semibold mb-4">About Me</h2>
      <p className="text-gray-400 max-w-2xl">
        I'm a computer engineering student passionate about software development. I started learning through FreeCodeCamp, YouTube, and Codecademy — and now I’m building full-stack projects and studying cybersecurity challenges like phishing detection.
      </p>
    </section>
  );
}
